import React  from "react";
import './YearFilter.css';
import LargeComponent from "../ItemsCollection/LargeComponent";

const FilterYear = (props) => {
    var items = props.items;
    const Handler1 = ()=>{
        items = props.items[3];
    };
    const Handler2 = ()=>{
        items = props.items[2];
    };
    const Handler3 = ()=>{
        items = props.items[1];
    };
    const Handler4 = ()=>{
        items = props.items[0];
    };
    /*const ExectionHandler = ()=>{
        const items = props.items;
    };*/
    return (
        <div>
            <div className="FilterCard">
                <div className="Filter">
                    <label>Filter By Year</label>
                    <select>
                        <option value="2019" onSelect={Handler1}>2019</option>
                        <option value="2020" onSelect={Handler2}>2020</option>
                        <option value="2021" onSelect={Handler3}>2021</option>
                        <option value="2022" onSelect={Handler4}>2022</option>
                    </select>
                </div>
                <div>
                    <LargeComponent items= {items} /*onExecute={ExectionHandler}*//>
                </div>
            </div>
        </div>
    );
};
export default FilterYear;
